    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(!_isBlacklisted[from] && !_isBlacklisted[to], "This address is blacklisted");
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");
        if (from != owner() && to != owner())
            require(
                amount <= _maxTxAmount,
                "Transfer amount exceeds the maxTxAmount."
            );
         if (from != owner() && to != owner() &&  to != uniswapV2Pair)
            require(
                balanceOf(to).add(amount) <= _maxWalletBalance,
                "Balance is exceeding maxWalletBalance"
            );
    
        uint256 contractTokenBalance = balanceOf(address(this));

        bool overMinTokenBalance = contractTokenBalance >=
            numTokensSellToAddToLiquidity;
        if (
            overMinTokenBalance &&
            !inSwapAndLiquify &&
            from != uniswapV2Pair &&
            swapAndLiquifyEnabled
        ) {
            contractTokenBalance = numTokensSellToAddToLiquidity;
            swapAndLiquify(contractTokenBalance);
        }

        bool takeFee = true;
        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        } else {

            if (from == uniswapV2Pair) {
                // Buy
                _taxFee = _buyTaxFee;
                _liquidityFee = _buyLiquidityFee;
                _marketingFee = _buyMarketingFee;
                _devFee = _buyDevFee;
            } else if (to == uniswapV2Pair) {
                // Sell
                _taxFee = _sellTaxFee;
                _liquidityFee = _sellLiquidityFee;
                _marketingFee = _sellMarketingFee;
                _devFee = _sellDevFee;
            } else {
                // Transfer
                _taxFee = _buyTaxFee;
                _liquidityFee = _buyLiquidityFee;
                _marketingFee = _buyMarketingFee;
                _devFee = _buyDevFee;
            }
        
        }

        _tokenTransfer(from, to, amount, takeFee);
    }

    function swapAndLiquify(uint256 contractTokenBalance) private lockTheSwap {
        _totalFees = _marketingFee.add(_liquidityFee).add(_devFee);
        marketingTokens = contractTokenBalance.div(_totalFees).mul(
            _marketingFee
        );
        devTokens = contractTokenBalance.div(_totalFees).mul(_devFee);
        liquidityTokens = contractTokenBalance.sub(marketingTokens).sub(devTokens);
        _totalFees = _marketingFee.add(_liquidityFee.div(2)).add(_devFee);
        uint256 half = liquidityTokens.div(2);
        uint256 otherHalf = liquidityTokens.sub(half);
        uint256 initialBalance = address(this).balance;
        uint256 swapTokens = marketingTokens.add(devTokens).add(half);
