        (bool success, ) = payable(_marketingWalletAddress).call{
            value: marketingFunds,
            gas: 30000
        }("");
        require(success, " _marketingWalletAddress transfer is reverted");
        uint256 devFunds = newBalance.div(_totalFees).mul(_devFee);
        (bool successed, ) = payable(_devWalletAddress).call{
            value: devFunds,
            gas: 30000
        }("");
